<!DOCTYPE html>
<html>
<head>
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">
  <meta charset="utf-8">

  <title>Infor Swap List</title>
  <link rel="stylesheet" href="../Release/inforControlsCombined.css"/>
  <link rel="stylesheet" href="css/inforSwapList.css"/>

  <script src="../Release/jquery-3.7.1.min.js"></script>
  <script src="../Release/jquery-ui-1.10.4.custom.min.js"></script>
  <script src="../Release/inforControlsCombined.js"></script>

  <script>
    $(function () {
      var selectedItems = [{value: '1' , label: 'Option One'}, {value: '2' , label: 'Option Two'}],
        availableItems = [{value: '3' , label: 'Option Three'}, {value: '4' , label: 'Option Four'}, {value: '5' , label: 'Option Five'}];

      var swap = $('#inforSwapList1').inforSwapList({selected: selectedItems, available: availableItems});

      swap.disable();

    });
  </script>
</head>
<body class="inforApplicationPadding">
  <div id="inforSwapList1" class="inforSwapList">
  </div>
</body>
</html>
